import React from "react";
import Person from "./card";
import axios from "axios";

function getEvents() {
  axios
    .get("http://localhost:5000/events/")
    .then((response) => {
      console.log(response);
      // this.setState({ topics: response.data });
      // console.log(this.state);
    })
    .catch((error) => console.log(error));
}

getEvents();

function NameList() {
  //   const names = ["Bruce", "Clark", "Diana"];
  // const events =
  const events = [
    {
      _id: {
        $oid: "60300e34d9a0e28a49a36b51",
      },
      country_mentions: ["United States"],
      text:
        '"America is back" and fully engaged in helping resolve global issues, US Secretary of State Antony Blinken says',
      topics: [
        "back",
        "resolve",
        "helping",
        "Secretary",
        "State",
        "Antony",
        "US",
      ],
    },
    {
      _id: {
        $oid: "60300e34d9a0e28a49a36b5b",
      },
      country_mentions: ["United States"],
      text: "Andrew Cuomo: Why is New York's governor facing controversy?",
      topics: ["Andrew", "York", "governor", "facing", "controversy", "Why"],
    },
    {
      _id: {
        $oid: "60300e34d9a0e28a49a36b65",
      },
      country_mentions: ["United States"],
      text:
        "Ferret becomes first North American endangered species to be cloned",
      topics: ["Ferret", "species", "North"],
    },
  ];
  const eventList = events.map((event) => <Person person={event} />);
  return <div>{eventList}</div>;
}

export default NameList;
